import React from 'react'
import ReactDOM from 'react-dom'
import posed from 'react-pose'
import SplitText from '../../../public/react-pose-text'
import './content.css'

// Full React Pose Text documentation can be found at
// https://popmotion.io/pose/api/react-pose-text

const Sidebar = posed.div({
  exit: {
    x: '-100%'
  },
  enter: {
    x: '0%',
    beforeChildren: true,
    staggerChildren: 50
  }
})

const charPoses = {
  exit: { opacity: 0 },
  enter: { opacity: 1 }
}

function Content () {
  return (
    <div className='container'>
      <Sidebar class='sidebar' initialPose='exit' pose='enter'>
        <h1>
          <SplitText charPoses={charPoses}>Contents</SplitText>
        </h1>
      </Sidebar>
    </div>
  )
}

const rootElement = document.getElementById('root')
ReactDOM.render(<Content />, rootElement)
export default Content
